import React from 'react';
import { useNavigate } from 'react-router-dom';
import { mockAppointments } from '../../mockData';
import '../styles/MyAppointments.css';

/**
 * MyAppointments Component - Display all user appointments
 * 
 * Learning Goals:
 * 1. Displaying list of appointments
 * 2. Conditional styling based on appointment status
 * 3. Actions on appointments (reschedule, cancel)
 * 4. Empty state handling
 */

function MyAppointments() {
  const navigate = useNavigate();

  /**
   * Handle appointment cancellation
   * In Phase 2, this will call backend API to delete appointment
   */
  const handleCancel = (appointmentId) => {
    if (window.confirm('Are you sure you want to cancel this appointment?')) {
      alert('‚úÖ Appointment cancelled successfully');
      // In Phase 2: API call to delete appointment
    }
  };

  /**
   * Handle appointment rescheduling
   * Navigate back to booking form to select new date/time
   */
  const handleReschedule = (appointment) => {
    navigate('/booking', { 
      state: { 
        selectedService: { id: 1, name: appointment.serviceName },
        rescheduleId: appointment.id 
      } 
    });
  };

  // Status badge styling
  const getStatusClass = (status) => {
    switch (status) {
      case 'Confirmed':
        return 'status-confirmed';
      case 'Cancelled':
        return 'status-cancelled';
      case 'Completed':
        return 'status-completed';
      default:
        return 'status-pending';
    }
  };

  return (
    <div className="appointments-container">
      <h1>üìÖ My Appointments</h1>

      {/* Empty State */}
      {mockAppointments.length === 0 ? (
        <div className="empty-state">
          <p>üì≠ No appointments booked yet</p>
          <button 
            className="book-btn"
            onClick={() => navigate('/dashboard')}
          >
            Book Your First Appointment
          </button>
        </div>
      ) : (
        <div className="appointments-list">
          {/* Upcoming Appointments */}
          <h2>Upcoming</h2>
          <div className="appointments-grid">
            {mockAppointments
              .filter(apt => new Date(apt.date) >= new Date() && apt.status !== 'Cancelled')
              .map((appointment) => (
                <div key={appointment.id} className="appointment-card">
                  {/* Appointment Header */}
                  <div className="appointment-header">
                    <h3>{appointment.serviceName}</h3>
                    <span className={`status-badge ${getStatusClass(appointment.status)}`}>
                      {appointment.status}
                    </span>
                  </div>

                  {/* Appointment Details */}
                  <div className="appointment-details">
                    <p><strong>üìã Service Type:</strong> {appointment.type}</p>
                    <p><strong>üìÖ Date:</strong> {new Date(appointment.date).toLocaleDateString()}</p>
                    <p><strong>‚è∞ Time:</strong> {appointment.time}</p>
                    <p><strong>üí∞ Amount:</strong> ‚Çπ{appointment.price}</p>
                    <p><strong>üìù Booked on:</strong> {appointment.bookedAt}</p>
                  </div>

                  {/* Action Buttons */}
                  <div className="appointment-actions">
                    <button 
                      className="btn-reschedule"
                      onClick={() => handleReschedule(appointment)}
                    >
                      üìÖ Reschedule
                    </button>
                    <button 
                      className="btn-cancel"
                      onClick={() => handleCancel(appointment.id)}
                    >
                      ‚úï Cancel
                    </button>
                  </div>
                </div>
              ))}
          </div>

          {/* Past Appointments */}
          {mockAppointments.some(apt => new Date(apt.date) < new Date()) && (
            <>
              <h2>Past Appointments</h2>
              <div className="appointments-grid">
                {mockAppointments
                  .filter(apt => new Date(apt.date) < new Date())
                  .map((appointment) => (
                    <div key={appointment.id} className="appointment-card past">
                      <div className="appointment-header">
                        <h3>{appointment.serviceName}</h3>
                        <span className="status-badge status-completed">Completed</span>
                      </div>

                      <div className="appointment-details">
                        <p><strong>üìã Service Type:</strong> {appointment.type}</p>
                        <p><strong>üìÖ Date:</strong> {new Date(appointment.date).toLocaleDateString()}</p>
                        <p><strong>‚è∞ Time:</strong> {appointment.time}</p>
                        <p><strong>üí∞ Amount:</strong> ‚Çπ{appointment.price}</p>
                      </div>

                      <div className="appointment-actions">
                        <button className="btn-rebook">
                          üîÑ Rebook Service
                        </button>
                        <button className="btn-review">
                          ‚≠ê Give Review
                        </button>
                      </div>
                    </div>
                  ))}
              </div>
            </>
          )}
        </div>
      )}

      {/* Back Button */}
      <button 
        className="back-btn"
        onClick={() => navigate('/dashboard')}
      >
        ‚Üê Back to Dashboard
      </button>
    </div>
  );
}

export default MyAppointments;
